import React, { Component } from 'react';
import '../styles/components/_sidebar.scss';

class SideBar extends Component {
    render() {
        return (
            <div className="sideBar">
                <div className="sideButton">
                    <svg>I</svg>
                </div>
                <div className="sideButton">
                    F
                </div>
                <div className="sideButton">
                    T
                </div>
            </div>
        )
    }
}

export default SideBar;
